import React from "react";
import "../timeline/Timeline.css";
import azamaka from "../images/azamaka.png";

const Timeline = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6">
          <h className="creationofizmasoft">
            The FizmaSoft Team created in Tashkent in 2016
          </h>
          <img
            className="azamaka img-fluid"
            style={{ maxWidth: "100%" }}
            src={azamaka}
            alt="azamaka"
          />
        </div>
        <div className="col-6"></div>
      </div>
    </div>
  );
};

export default Timeline;
